import React, { FC } from 'react';
import * as S from './logo.styles';

interface LogoProps {
  imageURL: string;
}

const Logo: FC<LogoProps> = ({ imageURL }) => {
  return (
    <div className="flex flex-initial w-96 h-96 self-start justify-self-start">
      <S.LogoStyle src={imageURL} />

    </div>
  );
};

export default Logo;
